            "နည်းဥပဒေ ၁။\nအသေးစိတ်ဖော်ပြချက် \n တုံ့ပြန်မှု၊ လူမှုဆန့်ကျင်ရေးကိုယ်ကျင့်တရား၊ နိုင်ငံရေးနှင့်နိုင်ငံရေးအရဆက်စပ်သည့်အကြမ်းဖက်သမားများစသည့်ဥပဒေများနှင့်စည်းမျဉ်းများကိုချိုးဖောက်သောအကြောင်းအရာဖြန့်ဝေခြင်း။\n\nအတည်ပြုနည်းလမ်း\n\n01. အသုံးပြုသူတုံ့ပြန်ချက်;\n02. Coplayer တုံ့ပြန်ချက်; \n03 ။ သို့မဟုတ်အခြားပြသရန်စာသားအထောက်အထား; \n04 ။ ပလက်ဖောင်းစောင့်ကြည့်လေ့လာရေး\n\nနည်းဥပဒေ 02 \nအသေးစိတ်ဖော်ပြချက် \n ညစ်ညမ်းရုပ်ပုံစာပေ၊ ပင်လယ်ဓားပြနှင့်ချိုးဖောက်မှုများကိုဥပဒေနှင့်စည်းမျဉ်းများကိုချိုးဖောက်သောမည်သည့်ပုံစံနှင့်မဆိုပျံ့နှံ့စေသည်\n\nအတည်ပြုချက်ကိုနည်းလမ်း \n01 ။ အသုံးပြုသူတုံ့ပြန်ချက်; \n02 ။ ကောင်းမွန်သောတုံ့ပြန်ချက်ကောင်း;\n03. သို့မဟုတ်အခြားပြသရန်စာသားအထောက်အထား; \n04 ။ ပလက်ဖောင်းစောင့်ကြည့်လေ့လာရေး\n\nနည်းဥပဒေ 03\nအသေးစိတ်ဖော်ပြချက်များ\nမည်သည့်ပုံစံဖြင့်မဆိုငွေလွှဲခြင်း (အခြားအသုံးပြုသူများနှင့်တွဲဖက်ကစားသူနှင့်အခြားလိုင်းများမှတဆင့်ငွေသွင်းခြင်း (တီးဝိုင်းမဟုတ်သောအမိန့်များ)\n\nအတည်ပြုနည်းလမ်း\n01. အသုံးပြုသူတုံ့ပြန်ချက်;\n02. ဘုရားသခင့တုံ့ပြန်မှု၊ \n03. သို့မဟုတ်အခြားပြသရန်စာသားကိုအထောက်အထား;\n04. ပလက်ဖောင်းစောင့်ကြည့်လေ့လာရေး\n\nနည်းဥပဒေ 04 \nအသေးစိတ်ဖော်ပြချက်\nမည်သည့်ပုံစံနှင့်မဆို၊ စင်မြင့်၏အကျိုးစီးပွားကိုပျက်စီးစေသည့်၊ ပလက်ဖောင်း၏အမိန့်ကိုပျက်ပြားစေပြီး၊ တတိယပါတီ၏ပုဂ္ဂိုလ်ရေး / ပလက်ဖောင်း / ကိရိယာ (ပလပ်ဂင်၊ ဇာတ်ညွှန်း / အကူအညီစသည်တို့) ကိုသတင်းအချက်အလက်များကိုပလက်ဖောင်းခွင့်ပြုချက်မရပဲဖြန့်ဖြူးသည်။ မည်သည့်ပုံစံဖြင့်မဆို\n\nအတည်ပြုချက်ကိုနည်းလမ်း \n01 ။ အသုံးပြုသူတုံ့ပြန်ချက်; \n02 ။ ကောင်းမွန်သောတုံ့ပြန်ချက်ကောင်း \n03 ။ သို့မဟုတ်အခြားပြသရန်စာသားကိုအထောက်အထား;\n04. ပလက်ဖောင်းစောင့်ကြည့်လေ့လာရေး\n\nအသုံးပြုသူများနှင့်အခြားနတ်ဘုရားများအားပျက်စီးစေသည့်မည်သည့်ပုံစံမျိုးမဆို (ဥပမာအမိန့်များပြီးစီးပြီးနောက် ၀န်ဆောင်မှုမခံရန်လှုံ့ဆော်ခြင်း၊ အမျိုးမျိုးသောလမ်းကြောင်းများမှတရားမဝင်ငွေများလွှဲပြောင်းခြင်း၊ အသုံးပြုသူ / အခြားကစားသမားပိုင်ဆိုင်မှုများအားဆုံးရှုံးစေခြင်း) ။\n\nအတည်ပြုချက်ကိုနည်းလမ်း \n01 ။ အသုံးပြုသူတုံ့ပြန်ချက်; \n02 ။ ကောင်းမွန်သောတုံ့ပြန်ချက်ကောင်း\n03. သို့မဟုတ်အခြားပြသရန်စာသားအထောက်အထား; \n04 ။ ပလက်ဖောင်းစောင့်ကြည့်လေ့လာရေး"),
